## Solução genial, onde eu aprendi que seria melhor pensar mais antes de começar a resolver o problema.
## Eu tinha chegado a algumas soluções mas estava sofrendo com performace, essa solução foi extremamente elegante.
## Alguns testes colados aqui traduzem a performace do código :D

class Solution:
    def maxProfit(self,valores):
        dia_de_compra = 0
        dia_de_venda = 1
        ganho_maximo = 0
        while dia_de_venda < len(valores):
            ganho_atual = valores[dia_de_venda] - valores[dia_de_compra] #our current Profit
            if valores[dia_de_compra] < valores[dia_de_venda]:
                ganho_maximo =max(ganho_atual,ganho_maximo)
            else:
                dia_de_compra = dia_de_venda
            dia_de_venda += 1
        return ganho_maximo


            


